	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (3, 'Chromoly steel.', hextoraw('3AED1E30821A554899CB2AFE8290D641'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (4, 'Aluminum alloy cups; large diameter spindle.', hextoraw('28A5EBDF11DA50469D86CAFDA7294EB0'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (5, 'Aluminum alloy cups and a hollow axle.', hextoraw('A78D17F77E1A9749847006737181305E'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (8, 'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.', hextoraw('E546678E97ADE246BD24FCEA075C3B52'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (64, 'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to  off-road.', hextoraw('904E1C7BE2859247B47BE0C424E2EC94'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (88, 'For true trail addicts.  An extremely durable bike that will  anywhere and keep you in control on challenging terrain - without breaking your budget.', hextoraw('53D21A4C7E35984AB02E02180AA406F6'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (128, 'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.', hextoraw('E60907131285B9499F621F5C99152056'), timestamp '2004-03-11 10:32:17.973');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (168, 'Top-of-the-line competition mountain bike. Performance-enhancing options include the innovative HL Frame, super-smooth front suspension, and traction for all terrain.', hextoraw('A69D97DBC84C71419ECF65003FF8178A'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (170, 'Suitable for any type of off-road trip. Fits any budget.', hextoraw('122477EA696316449CC9C1A5D1FF9C52'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (209, 'Entry level adult bike; offers a comfortable ride cross-country or down the block. Quick-release hubs and rims.', hextoraw('FD5FFFF57CCBD64ABBC94D250BB6E98D'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (249, 'Value-priced bike with many features of our top-of-the-line models. Has the same light, stiff frame, and the quick acceleration we''re famous for.', hextoraw('44F19142937660448B0B1373E0433021'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (320, 'Same technology as all of our Road series bikes, but the frame is sized for a woman.  Perfect all-around bike for road or racing.', hextoraw('D9DE30E1ECD05646BF4D1A3A46491891'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (321, 'Same technology as all of our Road series bikes.  Perfect all-around bike for road or racing.', hextoraw('DA29B4C751DCDB47A18E5891E76CCC16'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (337, 'A true multi-sport bike that offers streamlined riding and a revolutionary design. Aerodynamic design lets you ride with the pros, and the gearing will conquer hilly roads.', hextoraw('0B0F56DB0BE7A742A1F53B7E42D3679D'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (375, 'Cross-train, race, or just socialize on a sleek, aerodynamic bike.  Advanced seat technology provides comfort all day.', hextoraw('85217B742003E54F8E8F27B84A40A838'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (376, 'Cross-train, race, or just socialize on a sleek, aerodynamic bike designed for a woman.  Advanced seat technology provides comfort all day.', hextoraw('5B95D9F11CBC344DBE8BCDEE33E77087'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (409, 'Alluminum-alloy frame provides a light, stiff ride, whether you are racing in the velodrome or on a demanding club ride on country roads.', hextoraw('1467C73D727547459D79ABB708950B2C'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (457, 'This bike is ridden by race winners. Developed with the Adventure Works Cycles professional race team, it has a extremely light heat-treated aluminum frame, and steering that allows precision control.', hextoraw('EA8DDB3D37FC444E8C1D0BF7C6A723E3'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (513, 'All-occasion value bike with our basic comfort and safety features. Offers wider, more stable tires for a ride around town or weekend trip.', hextoraw('59AE1E74595EBC4D90862633392C2582'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (554, 'The plush custom saddle keeps you riding all day,  and there''s plenty of space to add panniers and bike bags to the newly-redesigned carrier.  This bike has stability when fully-loaded.', hextoraw('B255C9DD3E84CE498F7B54870F6135EB'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (594, 'Travel in style and comfort. Designed for maximum comfort and safety. Wide gear range takes on all hills. High-tech aluminum alloy construction provides durability without added weight.', hextoraw('922CB83245E5A04DA1750BE710B482FE'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (613, 'Superior shifting performance.', hextoraw('18867D9CC3A30F4C8C722E10124E88CA'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (618, 'Super rigid spindle.', hextoraw('7EFA5FE1E8BDE14D8E81F197A56E0C9D'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (619, 'High-strength crank arm.', hextoraw('AC082BB6DAA6BC43950F2DE2EB5720EB'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (620, 'Triple crankset; alumunim crank arm; flawless shifting.', hextoraw('25D244E9A7C6A64FA31FB6CE95E53203'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (627, 'All-weather brake pads; provides superior stopping by applying more surface to the rim.', hextoraw('A4F0F2EBF289314DBE48D8FD278F3024'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (630, 'Wide-link design.', hextoraw('2C68C428B238614BA2AEBCAC7C7CE29B'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (633, 'Stout design absorbs shock and offers more precise steering.', hextoraw('BFCDCC27027E28439C05E406BD2E5A60'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (634, 'Composite road fork with an aluminum steerer tube.', hextoraw('F020EE53E91DC2448A5D4CFA349F1A07'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (635, 'High-performance carbon road fork with curved legs.', hextoraw('029039C273E29B40816442F6E6BFCC6C'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (637, 'Our best value utilizing the same, ground-breaking frame technology as the ML aluminum frame.', hextoraw('91E59EF410B1F54CBC1762BB838DC58A'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (642, 'The ML frame is a heat-treated aluminum frame made with the same detail and quality as our HL frame. It offers superior performance. Men''s version.', hextoraw('FDEEFB35E6102044B0AE051B57FEFF36'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (644, 'The ML frame is a heat-treated aluminum frame made with the same detail and quality as our HL frame. It offers superior performance. Women''s version.', hextoraw('B5F9B9E42874344BB8EA3FB6EE4BC4F8'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (647, 'Each frame is hand-crafted in our Bothell facility to the optimum diameter and wall-thickness required of a premium mountain frame. The heat-treated welded aluminum frame has a larger diameter tube that absorbs the bumps.', hextoraw('9FE2D97ACF16B04DB073CC62D501B61A'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (661, 'Made from the same aluminum alloy as our top-of-the line HL frame, the ML features a lightweight down-tube milled to the perfect diameter for optimal strength. Women''s version.', hextoraw('549D1CD6C3226345A4180B9DC7E03850'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (686, 'Replacement mountain wheel for entry-level rider.', hextoraw('3A4BCC7D9A7EEC4EAAEE0E841CDBBEBC'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (687, 'Replacement mountain wheel for the casual to serious rider.', hextoraw('0EE918FD7A52124E9F526C07AC6EC3E8'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (688, 'High-performance mountain replacement wheel.', hextoraw('D8332FD4A859694A9A5B970FC4D8F745'), timestamp '2003-06-01 00:00:00');
